// Initialize values
for(let i = 0; i < MAP_HEIGHT; i++){
    visited.push([]);
    special.push([]);
    prev.push([]);
    for(let j = 0; j < MAP_WIDTH; j++){
        visited[i].push(-1);
        special[i].push(0);
        prev[i].push([-1, -1]);
    }
}

// Convert string to array
for(let i = 0; i < MAP_HEIGHT; i++){
    mapData[i] = mapData[i].split(",");
}

function resetSpecialPoints(){
    for(let i = 0; i < MAP_HEIGHT; i++){
        for(let j = 0; j < MAP_WIDTH; j++)
            special[i][j] = 0;
    }
}

function inRange(i, j){ return (i >= 0 && i < MAP_HEIGHT && j >= 0 && j < MAP_WIDTH); }


function coastlineSurrounding(x, y){
    return (
        (inRange(x + 1, y) && mapData[x + 1][y] <= 0) ||
        (inRange(x - 1, y) && mapData[x - 1][y] <= 0) ||
        (inRange(x, y + 1) && mapData[x][y + 1] <= 0) ||
        (inRange(x, y - 1) && mapData[x][y - 1] <= 0)
    );
}


let finishPos = [];

function bfs(xPos, yPos, threshold, seaLevel){
    let queue = [];

    queue.push([xPos, yPos, -1, -1]); // [x, y, prevX, prevY]

    while(queue.length > 0){
        let newXY = queue.shift();
        let x = newXY[0],
            y = newXY[1];

        if(y < 0 || y >= MAP_HEIGHT || x < 0 || x >= MAP_WIDTH) continue;
        if(mapData[y][x] > seaLevel) continue;
        if(visited[y][x] == threshold) continue;

        if(coastlineSurrounding(y, x)){
            finishPos = [y, x];
            prev[y][x] = [newXY[3], newXY[2]];
            return;
        }

        visited[y][x] = threshold;
        prev[y][x] = [newXY[3], newXY[2]];

        queue.push([x + 1, y, x, y]);
        queue.push([x - 1, y, x, y]);
        queue.push([x, y + 1, x, y]);
        queue.push([x, y - 1, x, y]);
    }
}

function getPath(x, y, numClicks){
    let l = 0,
        r = 256,
        mid;

    while(l < r){
        mid = Math.floor((l + r)/2);
        
        finishPos = [-1, -1];
        bfs(x, y, - numClicks - mid - 10, mid);

        if(finishPos[0] != -1) r = mid;
        else l = mid + 1;
    }

    bfs(x, y, -numClicks - 300, r);

    
    // Follow the path to highlight
    let curI = finishPos[0],
        curJ = finishPos[1];

    let cheapBarrier = Math.max(0, r - mapData[curI][curJ]);

    while(curI != -1){
        special[curI][curJ] = 2;

        if(prev[curI][curJ][0] != -1)
            cheapBarrier = Math.min(cheapBarrier, r - mapData[curI][curJ]);

        let prevPos = prev[curI][curJ];
        curI = prevPos[0];
        curJ = prevPos[1];
    }


    // Endpoints
    special[finishPos[0]][finishPos[1]] = 1;
    special[y][x] = 1;

    // [elevation, min. sea level required to flood, height of barrier for blocking at coastline, height of cheapest (shortest) barrier along path]
    return {
        elevation: mapData[y][x],
        minSeaLevel: r,
        coastlineBarrier: Math.max(0, r - mapData[finishPos[0]][finishPos[1]]),
        cheapestBarrier: cheapBarrier
    };
}

function drawGlobe(ctx, offset){
    ctx.fillStyle = "black";
    ctx.rect(0, 0, canvas.width, canvas.height);
    ctx.fill();

    let globalX = 0;

    offset = MAP_WIDTH * offset/(2 * PI);
    offset = Math.floor(offset);
    offset %= MAP_WIDTH;

    for(let i = offset; i < offset + MAP_SIZE; i++){
        for(let j = 0; j < MAP_SIZE; j++){

            let ii = i % MAP_WIDTH;
            let jj = j % MAP_HEIGHT;

            ctx.beginPath();
            
            // Calculations (only approximations, using half-circle equations)
            let newY = jj * 2*RADIUS/MAP_SIZE - RADIUS;
            let curRadDist = 2*Math.sqrt(RADIUS*RADIUS - newY*newY);
            let newX = curRadDist * (globalX - MAP_SIZE/2)/MAP_SIZE;


            let mapColor = [];


            // Colors with some shading
            if(mapData[jj][ii] > 0){
                // 0m - 3200m: dark green to dark brown -> rgb(0, 50, 0) to rgb(100, 50, 0)
                // 3200m - 6400m: dark brown to white -> rgb(100, 50, 0) to rgb(250, 250, 250)

                if(mapData[jj][ii] <= 125){
                    mapColor = [100 * mapData[jj][ii]/125,
                                50,
                                0];

                } else {
                    mapColor = [100 + 150 * (mapData[jj][ii] - 125)/125,
                                50 + 200 * (mapData[jj][ii] - 125)/125,
                                250 * (mapData[jj][ii] - 125)/125];
                }

            }
            else
                mapColor = [20, 50, 200];


            // Smooth red values for highlighted route
            if(special[jj][ii] == 2){
                mapColor[0] = 0.5*mapColor[0] + 0.5*255;
                mapColor[1] = 0.5*mapColor[1] + 0.5*0;
                mapColor[2] = 0.5*mapColor[2] + 0.5*0;

            } else if(special[jj][ii] == 1){
                mapColor = [255, 0, 0];
            }

            ctx.fillStyle = `rgb(${mapColor[0]}, ${mapColor[1]}, ${mapColor[2]})`;

            ctx.rect(newX*MAP_PIXEL_SPACING + MAP_X, newY*MAP_PIXEL_SPACING + MAP_Y, MAP_PIXEL_SIZE, MAP_PIXEL_SIZE);
            ctx.fill();
        }

        globalX++;
    }
}
